Blog, Blog, Blog . I havent posted in a long time. Im currently watching Desperate Housewives, chillin with mom and alicia and picking out stuff on my baby registry. Yay!&nbsp;

13 weeks along.&nbsp;

Nat

So I think it is time for a small update. I am about 9 weeks and 2 days along. Baby is growing fast. The tummy is showing now. But Im more sick than anything. Im doing well. Matt and I are still pondering names as we dont know if its a boy or girl. We will find out in late May-ish. I hope everything is well with everyone else. Im gonna go make some dinner now!&nbsp;

lots of lovins

Natalie/Astrid
